import { useEffect, useState } from "react";
import axios from "axios";
import Timer from "../components/Timer";

export default function Sessions() {
  const [sessions, setSessions] = useState([]);
  const [focusScore, setFocusScore] = useState("");
  const [showTimer, setShowTimer] = useState(false);
  const [duration, setDuration] = useState(25); // adaptive duration

  const token = localStorage.getItem("token");

  // Fetch session history on mount
  useEffect(() => {
    const fetchSessions = async () => {
      try {
        const res = await axios.get("http://localhost:5001/api/sessions", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setSessions(res.data);
      } catch (err) {
        console.error(err.response?.data || err.message);
      }
    };
    fetchSessions();
  }, [token]);

  // Adaptive duration logic based on focusScore
  const getAdaptiveDuration = (score) => {
    if (score >= 10) return 120;
    if (score >= 7) return 90;
    if (score >= 5) return 60;
    if (score >= 3) return 30;
    return 15;
  };

  // Start session with adaptive timer
  const startSession = () => {
    const score = Number(focusScore);
    if (isNaN(score) || score < 0 || score > 10) {
      alert("Enter a valid score between 0 and 10");
      return;
    }
    const adaptiveDuration = getAdaptiveDuration(score);
    setDuration(adaptiveDuration);
    setShowTimer(true);
  };

  // When timer completes, save session automatically
  const handleSessionComplete = async () => {
    try {
      const res = await axios.post(
        "http://localhost:5001/api/sessions",
        {
          focusScore: Number(focusScore),
          duration: duration, // send the actual duration used
        },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setSessions([res.data, ...sessions]);
      setFocusScore(""); // reset score input
      setShowTimer(false);
      alert("ðŸŽ‰ Session complete! Saved to history.");
    } catch (err) {
      console.error(err.response?.data || err.message);
      alert("Failed to save session");
    }
  };

  // Handle timer cancel/stop
  const handleTimerCancel = () => {
    setShowTimer(false);
    setFocusScore("");
  };

  return (
    <div className="max-w-md mx-auto mt-6">
      <h1 className="text-2xl font-bold mb-4">Sessions</h1>

      {/* Focus Score Input */}
      {!showTimer && (
        <div className="mb-4">
          <input
            type="number"
            placeholder="Focus Score (0-10)"
            value={focusScore}
            onChange={(e) => setFocusScore(e.target.value)}
            className="border px-2 py-1 rounded mr-2 w-28"
            min="0"
            max="10"
          />
          <button
            onClick={startSession}
            className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
            disabled={!focusScore}
          >
            Start Adaptive Session
          </button>
          {focusScore && (
            <p className="text-sm text-gray-600 mt-2">
              Suggested duration: {getAdaptiveDuration(Number(focusScore))} minutes
            </p>
          )}
        </div>
      )}

      {/* Timer Section */}
      {showTimer && (
        <div className="mb-4">
          <Timer 
            minutes={duration} 
            onComplete={handleSessionComplete}
            onCancel={handleTimerCancel}
          />
        </div>
      )}

      {/* History */}
      <h2 className="text-xl font-semibold mt-6 mb-3">History</h2>
      {sessions.length === 0 ? (
        <p className="text-gray-500">No sessions yet. Start your first session!</p>
      ) : (
        <ul className="list-disc pl-6 space-y-1">
          {sessions.map((s) => (
            <li key={s._id} className="text-sm">
              <strong>Type:</strong> {s.sessionType}, <strong>Duration:</strong> {s.duration} min, <strong>Score:</strong> {s.focusScore}
              <br />
              <span className="text-gray-500 text-xs">
                {new Date(s.createdAt).toLocaleString()}
              </span>
            </li>
          ))}
        </ul>
      )}

      {/* Logout Button */}
      <div className="mt-8">
        <button
          onClick={() => {
            localStorage.removeItem("token");
            window.location.href = "/login";
          }}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>
    </div>
  );
}
